import React, { Component } from "react";
import Pagos from "../components/Pay/pay";
import "./style.css";

export default class Pay extends Component {
  amount;

  componentWillMount() {
    const { amount } = this.props.location.state;

    if (amount) {
      this.amount = amount;
    } else {
      this.props.history.push("/cursoCiclo");
    }
  }

  render() {
    return (
      <div>
        <Pagos amount={this.amount}></Pagos>
      </div>
    );
  }
}
